import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import LoginForm from './pages/LoginPage';
import GlavniIzbornik from './pages/GlavniIzbornik'; // Ensure this component is correctly defined
import PopisLovaca from '../pages/PopisLovaca';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<LoginForm />} />
        <Route path="/glavni-izbornik" element={<GlavniIzbornik />} />
        <Route path="/popis-lovaca" element={<PopisLovaca />} />

        {/* Automatically redirect to the login page if no other routes match */}
        <Route path="*" element={<Navigate to="/login" replace />} />
      </Routes>
    </Router>
  );
}

export default App;
